import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";


function App() {
  const isAuthenticated = !!localStorage.getItem("token");

  return (
    <Router>
      <Routes>
        <Route path="/" element={isAuthenticated ? <Navigate to="/main" /> : <Navigate to="/login" />} />
        <Route path="/login" element={isAuthenticated ? <Navigate to="/main" /> : <LoginPage />} />
        <Route path="/register" element={isAuthenticated ? <Navigate to="/main" /> : <RegisterPage />} />
        <Route path="/main" element={isAuthenticated ? <MainPage /> : <Navigate to="/login" />} />
        <Route path="*" element={<Navigate to="/" />} />
      </Routes>
    </Router>
  );
}

export default App;
